export default function colorHandler() {
  const defineTaskColor = (taskColor) => {
    const color = [];
    switch(color) {
      case 'red':
        color['background'] = '#eeeeee';
        color['border'] = '#eeeeee';
        color['text'] = '#fff';
        break;
      default:
        color['background'] = '#81cd74';
        color['border'] = '#6fba62';
        color['text'] = '#ffffff';
    }

    return color;
  };

  return {
    defineTaskColor
  }
}
